SELECT POD, COUNT(1) FROM #TempRecords GROUP BY POD

DROP TABLE IF EXISTS #TempRecords_POD1
SELECT * INTO #TempRecords_POD1 FROM #TempRecords WHERE POD = 1 

SELECT * FROM #TempRecords_POD1

DROP TABLE IF EXISTS #DistinctAccounts
SELECT DISTINCT AccountNumber INTO #DistinctAccounts FROM #TempRecords_POD1

DROP TABLE IF EXISTS #GWC
SELECT T.*, C.TranID GWC_TID, C.TranTime GWC_TTime, C.PostTime GWC_PTime , C.TransactionAmount GWC_TAmount,
ROW_NUMBER() OVER (PARTITION BY T.AccountNumber ORDER BY C.PostTime) GWC_Rank
INTO #GWC
FROM #DistinctAccounts T
JOIN LS_P1MARPRODDB01.ccgs_coreissue.dbo.CreateNewSingleTransactionData C WITH (NOLOCK) ON (T.AccountNumber = C.AccountNumber)
WHERE C.CMTTranType = '49' AND TransactionStatus = 2 AND ActualTranCode = '4907' 

SELECT * FROM #GWC WHERE GWC_Rank > 1

DROP TABLE IF EXISTS #GWC_Sum
SELECT AccountNumber, SUM(GWC_TAmount) GWC_TAmount INTO #GWC_Sum FROM #GWC GROUP BY AccountNumber


UPDATE T
SET GWC_Amount = GWC_TAmount
FROM #TempRecords T
JOIN #GWC_Sum G ON (T.AccountNumber = G.AccountNumber)

SELECT *
FROM #TempRecords T
WHERE GWC_Amount > 0

DROP TABLE IF EXISTS #TempRecords
CREATE TABLE #TempRecords (ClientID VARCHAR(64),AccountUUID VARCHAR(64),AccountNumber VARCHAR(19),TranID DECIMAL(19,0),TransactionUUID VARCHAR(64),TranTime DATETIME,PostTime DATETIME,ClaimID VARCHAR(64),DisputeAmount MONEY,TransactionAmount MONEY,TotalPurchaseAmount MONEY,TotalPC MONEY,GWC_Amount MONEY,OTBHoldAmount MONEY,NetDisputeBalance MONEY,POD INT)

